        public class Solution
        {
            //t:O(n)
            public string RemoveDuplicates(string s, int k)
            {
                var stack = new Stack<Tuple<char, int>>();

                foreach (var c in s.ToCharArray())
                {
                    if (stack.Count == 0)
                    {
                        stack.Push(new Tuple<char, int>(c, 1));
                        continue;
                    }

                    var peek = stack.Peek();
                    if (peek.Item1 != c)
                    {
                        stack.Push(new Tuple<char, int>(c, 1));
                        continue;
                    }
                    stack.Pop();
                    if (peek.Item2 < k - 1)
                    {
                        stack.Push(new Tuple<char, int>(peek.Item1, peek.Item2+ 1));
                    }
                }

                var str = new StringBuilder();
                while (stack.Count > 0)
                {
                    var t = stack.Pop();
                    for (var i = 0; i < t.Item2; i++)
                    {
                        str.Append(t.Item1);
                    }
                }

                return new string(str.ToString().Reverse().ToArray());
            }
            //T:O(n!)
            public string RemoveDuplicates2(string s, int k)
            {
                List<char> list = new List<char>();
                for (int i = 0; i < s.Length; i++)
                    list.Add(s[i]);

                char current = ' ';

                bool run = false;

                do
                {
                    run = false;
                    int index = 0;
                    int count = 0;
                    for (int i = 0; i < list.Count; i++)
                    {
                        if (list[i] == ' ')
                        {

                        }
                        else if (list[i] == current)
                        {
                            count++;
                            if (count == k)
                            {
                                for (int j = index; j <= i; j++)
                                    list[j] = ' ';

                                run = true;
                            }
                        }
                        else
                        {
                            current = list[i];
                            index = i;
                            count = 1;
                        }
                    }

                    //Console.WriteLine(new String(list.ToArray()));
                }
                while (run);


                List<char> _list = new List<char>();
                for (int i = 0; i < list.Count; i++)
                {
                    if (list[i] != ' ')
                        _list.Add(list[i]);
                }

                return new String(_list.ToArray());
            }

            struct o
            {
                public char c;
                public int t;
                public o(char _c, int _t)
                {
                    c = _c;
                    t = _t;
                }
            }
            //T:O(k*n=n)
            public string RemoveDuplicates3(string s, int k)
            {
                Stack<o> os = new Stack<o>();
                foreach (char c in s.ToCharArray())
                {
                    if (os.Count == 0)
                        os.Push(new o(c, 1));
                    else
                    {
                        if (c == os.Peek().c)
                        {
                            var pop = os.Pop();
                            pop.t++;

                            if (pop.t < k)
                            {
                                os.Push(pop);
                            }

                        }
                        else
                        {
                            os.Push(new o(c, 1));
                        }
                    }
                }

                List<char> ret = new List<char>();
                while (os.Count > 0)
                {
                    var o = os.Pop();
                    for (int i = 0; i < o.t; i++)
                        ret.Add(o.c);
                }

                ret.Reverse();

                return new String(ret.ToArray());
            }

        }
